        public static byte[] CustomZLipDeComppress(byte[] origin)
        {
            using var ms = new MemoryStream(origin);
            using var zip = new NiaBukkit.API.Compress.ZLibStream(ms, CompressionMode.Decompress);
            using var rs = new MemoryStream();
            zip.CopyTo(rs);

            return rs.ToArray();
        }

        public static byte[] ZLipDeCompress(byte[] origin)
        {
            using var ms = new MemoryStream();
            using var zip = new Ionic.Zlib.ZlibStream(ms, Ionic.Zlib.CompressionMode.Decompress);
            zip.Write(origin, 0, origin.Length);
            zip.Close();

            return ms.ToArray();
        }
    }
